import React from "react";
import Card from "react-bootstrap/Card";
import ListGroup from "react-bootstrap/ListGroup";
import Button from "react-bootstrap/Button";
import { BsCalendarCheck } from "react-icons/bs";
import { AiOutlineClockCircle } from "react-icons/ai";
import { ImLocation } from "react-icons/im";
import havasi from "./../../media/images/Banners/Havasi.png";

function MuzicaClasicaBody() {
  return (
    <Card
      className="row d-flex justify-content-center mx-auto mb-5 mt-5"
      style={{ width: "50rem" }}
    >
      <Card.Img
        variant="top"
        src={havasi}
        style={{ height: "200px", width: "500px" }}
        className="mb-5"
      />
      <Card.Body>
        <Card.Title>HAVASI Symphonic Concert Show</Card.Title>
        {/* <Card.Text>
          Some quick example text to build on the card title and make up the
          bulk of the card's content.
        </Card.Text> */}
        <ListGroup className="list-group-flush">
          <ListGroup.Item>
            <Card.Text>
              <BsCalendarCheck class="me-2" />
              28 Decembrie{" "}
            </Card.Text>
            <Card.Text>
              <AiOutlineClockCircle class="me-2" />
              18:00
            </Card.Text>
            <Card.Text>
              <ImLocation /> Sala Palatului{" "}
            </Card.Text>
          </ListGroup.Item>
        </ListGroup>
        <Button variant="outline-warning" className="ms-2 mt-2">
          Cumpara Bilete
        </Button>{" "}
      </Card.Body>

      <Card.Img
        variant="top"
        src="holder.js/100px180?text=Image cap"
        style={{ height: "200px" }}
        className="mb-5"
      />
      <Card.Body>
        <Card.Title>HAVASI Symphonic Concert Show</Card.Title>
        {/* <Card.Text>
          Some quick example text to build on the card title and make up the
          bulk of the card's content.
        </Card.Text> */}
        <ListGroup className="list-group-flush">
          <ListGroup.Item>
            <Card.Text>
              <BsCalendarCheck class="me-2" />
              28 Decembrie{" "}
            </Card.Text>
            <Card.Text>
              <AiOutlineClockCircle class="me-2" />
              18:00
            </Card.Text>
            <Card.Text>
              <ImLocation /> Sala Palatului{" "}
            </Card.Text>
          </ListGroup.Item>
        </ListGroup>
        <Button variant="outline-warning" className="ms-2 mt-2">
          Cumpara Bilete
        </Button>{" "}
      </Card.Body>
    </Card>
  );
}

export default MuzicaClasicaBody;
